import { Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './User/login';
import Register from './User/register';

function App() {
  return (
    <div>




      <Routes>
        <Route path="" element={<Register/>}>


        </Route>
        <Route path="/login" element={<Login/>}/>
      </Routes>
    </div>
  );
}

export default App;
